import { createStore } from 'vuex'
// import axios from 'axios'

const store = createStore({
	state () {
		return {
			name: 'lee',
		}
	},
	// setter
	mutations: {

	},
	// getter
	actions: {
		getUserInfo(context) {
			console.log("context:", context);
		}
	}
});

export default store;
